Text:
@SerSpec-V
For some unknow reason the unlocker corrupt the files in .gmap folder so it's impossible to create a working Unlocked Mapsource Version (ATM).
A possible workaround is to install a locked MV, unlock the map in Mapsource with a generic code for MapID 2689 (USV99V54XC8NGYL7BNK2A7388), make a custom map, send it to a PC folder and then unlock it with gimgunlock.exe

@copgoat
Unrar one map in a USB drive (Garmin folder).
Start BaseCamp with the USB drive plugged in the PC.

@evo2310
Unrar one map in a SD (Garmin folder).
That's all.
